CREATE TABLE TeamProperty (
    team_id	INTEGER,
    owner_id INTEGER,
    team_name varchar(200),
    arena_name varchar(200),
    city_id INTEGER,
    FOREIGN KEY(owner_id) REFERENCES Owner(owner_id) ON DELETE CASCADE,
    PRIMARY KEY(team_id)
);


CREATE TABLE Player (
    player_id INTEGER,
    season NUMERIC,
    player_name varchar(200),
    team_id INTEGER,
    coach_id INTEGER,
    PRIMARY KEY(player_id)
);

CREATE TABLE PlayerRank (
    player_id INTEGER,
    season NUMERIC,
    position varchar(200),
    game NUMERIC,
    game_started NUMERIC,
    minutes_played NUMERIC,
    field_goal NUMERIC,
    field_goal_attempts NUMERIC,
    personal_fouls NUMERIC,
    turnovers NUMERIC,
    three_point NUMERIC,
    three_point_attempts NUMERIC,
    blocks NUMERIC,
    steals NUMERIC,
    free_throws_attempts NUMERIC,
    assists NUMERIC,
    total_rebounds NUMERIC,
    two_point_attempts NUMERIC,
    defensive_rebounds NUMERIC,
    free_throws NUMERIC,
    offensive_Rebounds NUMERIC,
    three_point_percent DECIMAL(3,2),
    two_point_percent DECIMAL(3,2),
    player_score NUMERIC,
    FOREIGN KEY(player_id) REFERENCES Player(player_id) ON DELETE CASCADE,
    PRIMARY KEY(player_id, season)
);


CREATE TABLE Match (
    game_id	INTEGER,
    date varchar(200),
    season NUMERIC,
    home_team_id INTEGER,
    pts_home NUMERIC,
    fg_pct_home NUMERIC,
    ft_pct_home NUMERIC, 
    fg3_pct_home NUMERIC,
    ast_home NUMERIC,
    reb_home NUMERIC,
    away_team_id INTEGER,
    pts_away NUMERIC,
    fg_pct_away NUMERIC,
    ft_pct_away NUMERIC,
    fg3_pct_away NUMERIC,
    ast_away NUMERIC,
    reb_away NUMERIC,
    PRIMARY KEY(game_id)
);


CREATE TABLE City (
    city_id INTEGER,
    city_name varchar(200),
    PRIMARY KEY(city_id)
);

CREATE TABLE Teamrank (
    team_id INTEGER,
    season NUMERIC,
    team_name varchar(200),
    g NUMERIC,
    w NUMERIC,
    l NUMERIC,
    FOREIGN KEY(team_id) REFERENCES TeamProperty(team_id) ON DELETE CASCADE,
    PRIMARY KEY(season, team_id)
);

CREATE TABLE Arena (
    arena_name varchar(200),
    capacity NUMERIC,
    PRIMARY KEY(arena_name)
);


CREATE TABLE Coach (
    coach_id INTEGER ,
    coach_name varchar(200),
    FOREIGN KEY(coach_id) REFERENCES Owner(coach_id) ON DELETE CASCADE,
	PRIMARY KEY(coach_id)
);

CREATE TABLE Owner (
    owner_id INTEGER ,
    owner_name varchar(200),
    coach_id INTEGER,
    manager_id INTEGER,
    FOREIGN KEY(owner_id) REFERENCES TeamProperty(owner_id) ON DELETE CASCADE,
    PRIMARY KEY(owner_id)
);

CREATE TABLE Manager (
    manager_id INTEGER ,
    manager_name varchar(200),
    FOREIGN KEY(manager_id) REFERENCES Owner(manager_id) ON DELETE CASCADE,
    PRIMARY KEY(manager_id)
);












